import React from 'react';
import './Tabs.css'

function Tabs() {

    function onTabClick(event) {
        console.log(event.target.id)
    }
    
    return ( 
        <React.Fragment>

        <button id='Tab1' onClick={onTabClick}>Tab 1</button>
        <button id='Tab2' onClick={onTabClick}>Tab 2</button>
        <button id='Tab3' onClick={onTabClick}>Tab 3</button>

        </React.Fragment>
     );
}

export default Tabs;
